import Vue from "vue";
import App from "./App.vue";

Vue.config.productionTip = false;

Vue.filter("invert", function(value) {
  return value
    .split("")
    .reverse()
    .join("");
});

new Vue({
  render: h => h(App)
}).$mount("#app");
